import React, { useState } from 'react';

const EXAMPLE_PROMPTS = [
  "Alert me when a token is mentioned in 3+ alpha groups within 30 minutes",
  "Show tokens with 5+ smart money buys in the last hour",
  "Find tokens with 300%+ volume spike and no exit liquidity",
  "Monitor GambleFi tokens with rising social sentiment"
];

const previewTokens = [
  { name: 'PAWPAW', risk: 'Low', meta: 'GambleFi', roi: '+24%' },
  { name: 'BABY BOB', risk: 'Low', meta: 'GambleFi', roi: '+34%' },
];

export default function CreateTab({ goBack }) {
  const [prompt, setPrompt] = useState('');
  const [strategy, setStrategy] = useState(null);
  const [isTyping, setIsTyping] = useState(false);

  const handlePromptSubmit = async () => {
    setIsTyping(true);

    // Mock API delay
    await new Promise(resolve => setTimeout(resolve, 1000));

    // Mock strategy parsing
    const newStrategy = {
      name: "Custom Strategy",
      description: prompt,
      rules: parsePromptToRules(prompt),
      status: 'active'
    };

    setStrategy(newStrategy);
    setIsTyping(false);
  };

  const parsePromptToRules = (text) => {
    // Mock rule parsing - in reality this would be more sophisticated
    const rules = [];

    if (text.toLowerCase().includes('telegram') || text.toLowerCase().includes('group')) {
      rules.push({
        type: 'telegram',
        description: 'Monitor Telegram groups for token mentions',
        icon: 'üì±'
      });
    }

    if (text.toLowerCase().includes('volume')) {
      rules.push({
        type: 'volume',
        description: 'Track volume spikes',
        icon: 'üìà'
      });
    }

    if (text.toLowerCase().includes('smart') || text.toLowerCase().includes('buy')) {
      rules.push({
        type: 'smart-money',
        description: 'Monitor smart money wallets',
        icon: 'üß†'
      });
    }

    if (text.toLowerCase().includes('gamblefi')) {
      rules.push({
        type: 'narrative',
        description: 'Track GambleFi narrative',
        icon: 'üé≤'
      });
    }

    return rules;
  };

  return (
    <div className="relative h-screen w-full bg-black text-white">
      {goBack && (
        <div className="pt-6 pl-6">
          <button
            onClick={goBack}
            className="flex items-center text-sm text-blue-400 hover:underline focus:outline-none bg-black/50 px-3 py-2 rounded-lg backdrop-blur-sm z-50 relative"
          >
            <span className="mr-2">‚Üê</span> Back to Home
          </button>
        </div>
      )}

      <div className="max-w-4xl mx-auto px-6 py-8">
        {/* Natural Language Input */}
        <div className="mb-8">
          <h2 className="text-2xl font-bold mb-4">Create Strategy</h2>
          <div className="relative">
            <textarea
              value={prompt}
              onChange={(e) => setPrompt(e.target.value)}
              placeholder="Describe your strategy in natural language..."
              className="w-full h-32 bg-zinc-900 rounded-xl p-4 text-white placeholder:text-zinc-600 focus:outline-none focus:ring-2 focus:ring-purple-500 resize-none"
            />
            <button
              onClick={handlePromptSubmit}
              disabled={!prompt || isTyping}
              className={`absolute bottom-4 right-4 px-4 py-2 rounded-lg ${
                !prompt || isTyping
                  ? 'bg-zinc-800 text-zinc-600'
                  : 'bg-purple-500 text-white hover:bg-purple-600'
              }`}
            >
              {isTyping ? 'Thinking...' : 'Create Strategy'}
            </button>
          </div>

          {/* Example Prompts */}
          <div className="mt-4">
            <p className="text-sm text-zinc-500 mb-2">Example prompts:</p>
            <div className="flex flex-wrap gap-2">
              {EXAMPLE_PROMPTS.map((example, i) => (
                <button
                  key={i}
                  onClick={() => setPrompt(example)}
                  className="text-sm bg-zinc-900 text-zinc-400 px-3 py-1 rounded-full hover:bg-zinc-800"
                >
                  {example}
                </button>
              ))}
            </div>
          </div>
        </div>

        {/* Strategy Preview */}
        {strategy && (
          <div className="bg-zinc-900 rounded-xl p-6 mb-8">
            <h3 className="text-xl font-bold mb-4">Strategy Preview</h3>
            <p className="text-zinc-400 mb-4">{strategy.description}</p>

            <div className="space-y-3 mb-6">
              {strategy.rules.map((rule, i) => (
                <div key={i} className="flex items-center gap-3 bg-zinc-800 p-3 rounded-lg">
                  <span className="text-2xl">{rule.icon}</span>
                  <span className="text-zinc-300">{rule.description}</span>
                </div>
              ))}
            </div>

            <div className="flex gap-3">
              <button className="flex-1 bg-purple-500 text-white py-2 rounded hover:bg-purple-600">
                Deploy Strategy
              </button>
              <button className="flex-1 border border-zinc-700 text-white py-2 rounded hover:bg-zinc-800">
                Edit Strategy
              </button>
            </div>
          </div>
        )}

        {/* Live Preview */}
        {strategy && (
          <div className="bg-zinc-900 rounded-xl p-6">
            <div className="flex items-center justify-between mb-4">
              <h3 className="text-xl font-bold">Live Preview</h3>
              <span className="text-xs bg-green-800 px-2 py-1 rounded text-green-300">LIVE</span>
            </div>
            <div className="space-y-3">
              {previewTokens.map((t) => (
                <div key={t.name} className="bg-zinc-800 rounded-lg p-4 flex justify-between items-center hover:bg-zinc-700 transition cursor-pointer">
                  <div>
                    <div className="font-semibold">{t.name}</div>
                    <div className="text-sm text-zinc-400">Risk: {t.risk} ‚Ä¢ Meta: {t.meta}</div>
                  </div>
                  <div className="text-green-400 font-bold">{t.roi}</div>
                </div>
              ))}
            </div>
          </div>
        )}
      </div>
    </div>
  );
}
